DROP FUNCTION IF EXISTS `fgetcantcat`;;
CREATE FUNCTION `fgetcantcat`(`catid` INT, `scid` INT) RETURNS int(11)
begin
    declare resu INT(11);
    SELECT COALESCE(Count(COALESCE(a.codartid,0)),0) INTO resu
      FROM articulos AS a
     WHERE a.categid = catid 
       AND (a.sctid = scid OR 0 = scid);
    return resu;
end;;

DROP FUNCTION IF EXISTS `fgetinvavgdry`;;
CREATE FUNCTION `fgetinvavgdry`(artid int) RETURNS decimal(10,2)
begin
    declare avgdry DECIMAL(10,2);
    
        SELECT ROUND((COALESCE(SUM(COALESCE(io.inv_qty,0)),0))/30,2) INTO avgdry
          FROM inventory_io AS io
         WHERE io.inv_inout = 1 
           AND io.art_id = artid
           AND DATE(io.inv_datetime) >= ADDDATE(CURDATE(), -30);    
    
    return avgdry;
end;;

